import React, { useEffect, useState } from "react";
import {
    View,
    Text,
    StyleSheet,
    ScrollView,
    ActivityIndicator,
    TouchableOpacity,
    TextInput,
    Image,
    CheckBox,
} from "react-native";
import { useNavigate } from "react-router-dom";
import Squ4 from "./AlwaysActive/images/sq4.png";
import listic from "./AlwaysActive/images/listic.png";
import Filter from "./AlwaysActive/images/filter.png";
import Nutzer from "./AlwaysActive/images/nutzer.png";
import arrow from "./AlwaysActive/images/arrow.png";
import { fetchAllPersons } from "../Application/personService";

const Persons = ({ darkMode, isEnglish }) => {
    const [persons, setPersons] = useState([]);
    const [filteredPersons, setFilteredPersons] = useState([]);
    const [searchText, setSearchText] = useState("");
    const [searchByFirstName, setSearchByFirstName] = useState(true);
    const [searchByLastName, setSearchByLastName] = useState(false);
    const [searchByBoth, setSearchByBoth] = useState(false);
    const [showFilters, setShowFilters] = useState(false);
    const [changeListView, setListView] = useState(true);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        const loadPersons = async () => {
            try {
                const allPersons = await fetchAllPersons();
                setPersons(allPersons);
                setFilteredPersons(allPersons);
            } catch (err) {
                setError(isEnglish ? "Failed to load data." : "Daten konnten nicht geladen werden.");
            } finally {
                setLoading(false);
            }
        };

        loadPersons();
    }, []);

    useEffect(() => {
        const filterPersons = () => {
            const lowercasedSearchText = searchText.toLowerCase();
            const filtered = persons.filter((person) => {
                const fullName = `${person.vorname} ${person.nachname}`.toLowerCase();
                if (searchByFirstName) {
                    return person.vorname?.toLowerCase().includes(lowercasedSearchText);
                } else if (searchByLastName) {
                    return person.nachname?.toLowerCase().includes(lowercasedSearchText);
                } else if (searchByBoth) {
                    return fullName.includes(lowercasedSearchText);
                }
                return true;
            });
            setFilteredPersons(filtered);
        };

        filterPersons();
    }, [searchText, searchByFirstName, searchByLastName, searchByBoth, persons]);

    if (loading) {
        return (
            <View style={styles.loader}>
                <ActivityIndicator size="large" color="#f0af4d" />
                <Text>{isEnglish ? "Loading data..." : "Daten werden geladen..."}</Text>
            </View>
        );
    }

    if (error) {
        return (
            <View style={styles.errorContainer}>
                <Text style={styles.errorText}>{error}</Text>
            </View>
        );
    }

    return (
        <View style={[styles.container, darkMode ? styles.darkBg : styles.lightBg]}>
            <View style={styles.header}>
                <Text style={[styles.welcomeText, darkMode ? styles.darkText : styles.lightText]}>
                    {isEnglish ? "Persons" : "Personen"}
                </Text>
                <View style={styles.searchContainer}>
                    <TouchableOpacity
                        style={[styles.filterButton, changeListView && styles.activeButton]}
                        onPress={() => setListView(true)}
                    >
                        <Image style={styles.icon} source={Squ4} />
                    </TouchableOpacity>
                    <TouchableOpacity
                        style={[styles.filterButton, !changeListView && styles.activeButton]}
                        onPress={() => setListView(false)}
                    >
                        <Image style={styles.icon} source={listic} />
                    </TouchableOpacity>
                    <View style={[styles.searchBarWrapper, darkMode ? styles.darkInputBorder : styles.lightInputBorder]}>
                        <TextInput
                            style={[styles.searchBar, darkMode ? styles.darkText : styles.lightText]}
                            placeholder={isEnglish ? "Search persons" : "Personen suchen"}
                            placeholderTextColor={darkMode ? "#bbb" : "#333"}
                            value={searchText}
                            onChangeText={(text) => setSearchText(text)}
                        />
                        <TouchableOpacity onPress={() => setShowFilters(!showFilters)}>
                            <Image style={styles.icon} source={Filter} />
                        </TouchableOpacity>
                    </View>
                </View>
            </View>

            {showFilters && (
                <View style={[styles.dropdown, darkMode ? styles.darkDropdown : styles.lightDropdown]}>
                    <View style={styles.checkBoxItem}>
                        <CheckBox
                            value={searchByFirstName}
                            onValueChange={() => {
                                setSearchByFirstName(!searchByFirstName);
                                setSearchByLastName(false);
                                setSearchByBoth(false);
                            }}
                        />
                        <Text style={darkMode ? styles.darkText : styles.lightText}>
                            {isEnglish ? "Search by first name" : "Suche nach Vornamen"}
                        </Text>
                    </View>
                    <View style={styles.checkBoxItem}>
                        <CheckBox
                            value={searchByLastName}
                            onValueChange={() => {
                                setSearchByLastName(!searchByLastName);
                                setSearchByFirstName(false);
                                setSearchByBoth(false);
                            }}
                        />
                        <Text style={darkMode ? styles.darkText : styles.lightText}>
                            {isEnglish ? "Search by last name" : "Suche nach Nachnamen"}
                        </Text>
                    </View>
                </View>
            )}

            <ScrollView contentContainerStyle={styles.scrollViewContent}>
                {changeListView ? (
                    <View style={styles.personGrid}>
                        {filteredPersons.map((person, index) => (
                            <View key={index} style={[styles.personBox, darkMode ? styles.darkBox : styles.lightBox]}>
                                <TouchableOpacity onPress={() => navigate(`/person/${person.id}`)}>
                                    <Image style={styles.images} source={Nutzer} />
                                    <View style={styles.line}></View>
                                    <Text style={[styles.personName, darkMode ? styles.darkText : styles.lightText]}>{person.vorname}</Text>
                                    <Text style={[styles.personName, darkMode ? styles.darkText : styles.lightText]}>{person.nachname}</Text>
                                </TouchableOpacity>
                            </View>
                        ))}
                    </View>
                ) : (
                    <View style={styles.simpleList}>
                        {filteredPersons.map((person, index) => (
                            <View key={index} style={styles.simpleListItem}>
                                <TouchableOpacity onPress={() => navigate(`/person/${person.id}`)} style={{ flexDirection: "row", alignItems: "center" }}>
                                    <Text style={[styles.listText, darkMode ? styles.darkText : styles.lightText]}>
                                        {person.nachname} {person.vorname} ({person.typ})
                                    </Text>
                                    <Image style={{ width: 20, height: 20, marginLeft: 10 }} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        ))}
                    </View>
                )}
            </ScrollView>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, padding: 20 },
    lightBg: { backgroundColor: "#fff" },
    darkBg: { backgroundColor: "rgb(18, 18, 18)" },
    darkText: { color: "#fff" },
    lightText: { color: "#000" },
    header: { flexDirection: "row", justifyContent: "space-between", alignItems: "center" },
    welcomeText: { fontWeight: "bold", fontSize: 50 },
    searchContainer: { flexDirection: "row", alignItems: "center" },
    searchBarWrapper: { flexDirection: "row", alignItems: "center", borderRadius: 5, paddingHorizontal: 10, height: 40 },
    lightInputBorder: { borderWidth: 1, borderColor: "gray" },
    darkInputBorder: { borderWidth: 1, borderColor: "rgb(85, 129, 176)" },
});

export default Persons;
